article_content:
생각보다 너무 작고
많이 들어 가지도 않고 ;;;

싸이즈는 딱 좋은데;;; ㅠㅠ

아놔!!!!!!!!! 졸라 빡치네;;;;
애들 장난감 금고를 파는건지;;;;;;
등록되지않은 발가락도 열림!!!!
지문인식을 오른손 엄지,검지,새끼손가락만 등록했는데...
왜 등록 하지도않은 오른손가락이 락 해제가 되는지;;;;;
더 웃긴건;;;;; 등록하지도않 다른사람 손가락도 열린다는점...
다른분들은 그러지 않은듯한데.... 내꺼만그러는건지...지문인식이 불량인지... 하;;;;
스마트폰 지문인식보다도 못하는듯...
제발.... 내꺼만 그런거라고 누가 얘기해줘요ㅠㅠ
이건 귀중품 보관하는 금고인지 애들 장난감인지....
15만원대 금고....라서 그런건지....
여친한테 개욕을 먹었네요.... 사지말라고 했는데 살거면
제습기 사라고했는데... 그럴줄알았다고ㅋㅋㅋ

금고 자체는 탄탄하니 좋은데 잠글때 뚜껑꽉눌러서 잘잠궈야되네요!
잘잠궛는데 계속 뚜껑이 열려서 고장인줄알앗는.;;
꽉안닫아서 잠금장치가 잘안걸린거엿네요.;

아이랑 즐겁게 저금하려고 사봤어요. 귀엽기로 말할것 같으면 최고봉.
아이가 너무 좋아해서....집에있는 동전이 다 털리고 있어요;;;
동전이 많이 들어가지 않고 어찌보면 조잡한것 같아 보이는데 귀여우니 용서됩니다;;;

비번이 계속 설정이 안되서 그냥 키로만 열려고요;;;
설명서 대로 계속하는데 비번 설정은 안되고
삐소리만 하루 종일 듣네요^^

아들사줬는데 완전만족이랍니다
전사주기만하고 사용을안해봐서^^;
사이즈는 작습니다

옆에 찌그러져서 와서 교환신청했는데 따로 교환신청할때 업체로 전화를 달라던지 그런게 적혀있지도 않아서 쿠팡에서 바로 교환신청했고 1주일넘게 안오길래 전화했더니 창고에 두고 확인이 안됐다고 하네요
그리고 1주일이 넘어서 교환이 안되고 반품처리 해야된다고;;
선물할꺼였는데 빠른처리가 안돼서 제대로 선물도 못했네요.

마감이 다소 미흡하며.. 생각보다 더 흐린 핑크색;;
미니금고로 다자인적&가성비 오 구매했는데
마감이 생각보다 아쉽네요;;
그라고 색상이 핫핑크 인줄 알았는데…
레알 연핑크 분홍색 입니다 ㅠㅠ

뭐 그래도 검정/파랑보다는 나은거 같지만;;
차라리 빨강색이였다면..
옆에서 보면 금고인지도 모를 그런 색상이네요.

아무튼 잘 써보겠습니다!
